import { NavLink } from "react-router-dom";

import classes from "./EventsNavigation.module.css";

function EventsNavigation() {
  const activLink = ({ isActive }) => (isActive ? classes.active : undefined);

  return (
    <header className={classes.header}>
      <nav>
        <ul className={classes.list}>
          <li>
            <NavLink on="/events" className={activLink} end>
              All Events
            </NavLink>
          </li>
          <li>
            <NavLink on="/events/new" className={activLink}>
              New Event
            </NavLink>
          </li>
        </ul>
      </nav>
    </header>
  );
}

export default EventsNavigation;
